import NavBar from "./NavBar";


const Home = () => {
  return (
    <div className="">
      <NavBar />
      <div className="flex p-10">
        <div className="">
          <h3 className="text-white text-5xl">Providing students with all the help they need</h3>
        </div>
        <img src="home.png"></img>
      </div>
    </div>
  );
};

export default Home;
